points:
  rotate: 0
  zones:
    matrix:
      columns:
        pinky:
          origin: [ 0, -1cy ]
          rotate: 19  # 19 degrees
          stagger: 0 # affects distance to previous column so useless for a left pinky column
          spread: 0 # affects distance to previous column so useless for a left pinky column
          key:
            column_net: P4
            column_mark: P
        ring:
          origin: [ 0, -1cy ]
          rotate: -4 # 15 degrees
          stagger: 10
          spread: 23
          key:
            column_net: P5
            column_mark: R
        middle:
          origin: [ 0, -1cy ]
          rotate: -10 # 5 degrees
          stagger: -1
          spread: 18
          key:
            column_net: P6
            column_mark: M
        index:
          origin: [ 0, -1cy ]
          rotate: -5 # 0 degrees
          stagger: -3
          spread: 20
          key:
            column_net: P21
            column_mark: IN
        inner:
          origin: [ 0, -1cy ]
          rotate: 0
          stagger: -1
          key:
            column_net: P20
            column_mark: I
      rows:
        bottom:
          padding: 1cy
          row_net: P16
        home:
          padding: 1cy
          row_net: P10
        top:
          padding: 1cy
          row_net: P18
    thumbfan:
      anchor:
        ref: matrix_inner_bottom
        shift: [ -3, -22 ]
      columns:
        near:
          rotate: -15
          key:
            column_net: P6
            column_mark: M
        home:
          spread: 19
          rotate: -10 # -25 degrees cumulative
          origin: [-9.5, -9]
          key:
            column_net: P5
            column_mark: R
        far:
          spread: 19
          rotate: -10 # 35 degrees cumulative
          origin: [-9.5, -9]
          key:
            column_net: P4
            column_mark: P
      rows:
        thumb:
          padding: 0
          row_net: P7
  key:
    bind: 0.1
    footprints:
      choc_hotswap:
        type: choc
        nets:
          from: =colrow
          to: =column_net
        params:
          keycaps: true
          reverse: true
          hotswap: true
      choc:
        type: choc
        anchor:
          rotate: 180
        nets:
          from: =colrow
          to: =column_net
        params:
          keycaps: true
          reverse: true
      diode:
        type: diode
        anchor:
          rotate: 90
          shift: [ 8.25, 0 ]
        nets:
          from: =colrow
          to: =row_net
        params:
          via_in_pad: true
          through_hole: false
outlines:
  exports:
    raw:
      - type: keys
        side: left
        size: [ 1cx,1cy ]
        corner: 0
        bevel: 0
      - type: rectangle
        size: [20, 7]
        anchor:
          ref: matrix_index_home
          shift: [-0.5cx, -0.5cy]
        operation: add
      - type: rectangle
        size: [20, 7]
        anchor:
          ref: matrix_pinky_home
          shift: [-3, -0.5cy]
        operation: add
      - type: rectangle
        size: [20, 7]
        anchor:
          ref: matrix_index_home
          shift: [-20, -0.5cy]
          rotate: 0
        operation: add
      - type: rectangle
        size: [20, 7]
        anchor:
          ref: matrix_middle_home
          shift: [-20, -0.5cy-3]
          rotate: 7
        operation: add
      - type: rectangle
        size: [5, 20]
        anchor:
          ref: matrix_inner_bottom
          shift: [0, -20]
          rotate: -1
        operation: add
      - type: rectangle
        size: [20, 5]
        anchor:
          ref: thumbfan_near_thumb
          shift: [0, 3]
          rotate: -8
        operation: add
      - type: rectangle
        size: [20, 5]
        anchor:
          ref: thumbfan_home_thumb
          shift: [0, -0.2]
          rotate: 0
        operation: add
      - type: rectangle
        size: [20, 3cy + 0.1]
        anchor:
          ref: matrix_inner_bottom
          shift: [0.7cx, -0.5cy -0.1]
          rotate: 0
        operation: add
      - type: rectangle
        size: [20, 7]
        anchor:
          ref: matrix_inner_bottom
          shift: [0, -0.5cy - 0.1]
          rotate: 0
        operation: add
      - type: rectangle
        size: [20, 7]
        anchor:
          ref: matrix_inner_home
          shift: [0, -0.5cx]
          rotate: 0
        operation: add
      - type: rectangle
        size: [20, 7]
        anchor:
          ref: matrix_inner_top
          shift: [0, -0.5cx]
          rotate: 0
        operation: add
    panel:
      - type: outline
        name: raw
        fillet: 1
    test:
      - type: outline
        name: raw
        fillet: 1
    switch_cutouts:
      - type: keys
        side: left
        size: 14
        bound: false
